import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './../style/Navbar.css';

function Navbar() {
    const [isNavExpanded, setIsNavExpanded] = useState(false);

    return (
        <nav className={`navbar ${isNavExpanded ? 'expanded' : ''}`}>
            <button className="hamburger" onClick={() => setIsNavExpanded(!isNavExpanded)}>
            </button>
            <div className="nav-menu">
                <Link to="/home" className="nav-link" onClick={() => setIsNavExpanded(true)}>Inicio</Link>
                <Link to="/automation" className="nav-link" onClick={() => setIsNavExpanded(false)}>Automatizaci√≥n</Link>
                <Link to="/processes" className="nav-link" onClick={() => setIsNavExpanded(false)}>Procesos</Link>
                <Link to="/contact" className="nav-link" onClick={() => setIsNavExpanded(false)}>Contacto</Link>
            </div>
        </nav>
    );
}

export default Navbar;
